import React from 'react';


import Title from "./components/Title";
import Maps from "./components/Maps";


var locations = [{
  name: "Nairobi",
  lat: -1.28333,
  lng: 36.81667
}, {
  name: "Bangalore",
  lat: 12.9716,
  lng: 77.5946
}, {
  name: "Stockholm",
  lat: 59.3293,
  lng: 18.0686
}];

class App extends React.Component {

  render() {    

    return (
      <div>
        <Title />
        <Maps
            id="myMap"
            options={{
              center: { 
                lat: 38.9637,
                lng: 35.2433 },
              zoom: 2.5
            }}
            onMapLoad={map => {
              const marker = locations.map(function (location, i) {
                return new window.google.maps.Marker({
                  position: location,
                  map:map,
                  animation: window.google.maps.Animation.DROP,
                  title : location.name,
                  icon: "https://c.tadst.com/gfx/w//40/wt-33.png"
                });
              });
          }}    
        />       

      </div>
    );
  }
}

export default App;
